			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# Sets the target folders and the final framework product.\nFMK_NAME=${PROJECT_NAME}\n\n# Install dir will be the final output to the framework.\n# The following line create it in the root folder of the current project.\nINSTALL_BASE_DIR=${SRCROOT}/../SDK/ShareSDK\nINSTALL_DIR=${INSTALL_BASE_DIR}/${FMK_NAME}.framework\n\n# Working dir will be deleted after the framework creation.\nWRK_DIR=build\nDEVICE_DIR=${WRK_DIR}/Release-iphoneos/${FMK_NAME}.framework\nSIMULATOR_DIR=${WRK_DIR}/Release-iphonesimulator/${FMK_NAME}.framework\n\n# -configuration ${CONFIGURATION}\n# Clean and Building both architectures.\nxcodebuild BITCODE_GENERATION_MODE=bitcode OTHER_CFLAGS=\"-fembed-bitcode\" -arch \"armv7s\" -arch \"armv7\" -arch \"arm64\" -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphoneos clean build\nxcodebuild BITCODE_GENERATION_MODE=bitcode OTHER_CFLAGS=\"-fembed-bitcode\" -arch \"i386\" -arch \"x86_64\" -configuration \"Release\" -target \"${FMK_NAME}\" -sdk iphonesimulator clean build\n\n# Cleaning the oldest.\nif [ -d \"${INSTALL_DIR}\" ]\nthen\nrm -rf \"${INSTALL_DIR}\"\nfi\n\nmkdir -p \"${INSTALL_DIR}\"\n\ncp -R \"${DEVICE_DIR}/\" \"${INSTALL_DIR}/\"\n\n# Uses the Lipo Tool to merge both binary files (i386 + armv6/armv7) into one Universal final product.\nlipo -create \"${DEVICE_DIR}/${FMK_NAME}\" \"${SIMULATOR_DIR}/${FMK_NAME}\" -output \"${INSTALL_DIR}/${FMK_NAME}\"\n\nrm -r \"${WRK_DIR}\"";
		};
		E2EA70B91CABC2F800B33983 /* Run Script */ = {
			isa = PBXShellScriptBuildPhase;
			buildActionMask = 2147483647;
			files = (
			);
			inputPaths = (
			);
			name = "Run Script";
			outputPaths = (
			);
			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "#发布文件夹\nBUNDLE_RELEASE=${SRCROOT}/../SDK\nBUNDLE_DIR=${BUNDLE_RELEASE}/ShareSDK.bundle\nBUNDLE_SCRIPT_DIR=${BUNDLE_DIR}/ScriptCore\nBUNDLE_PLATFORM_DIR=${BUNDLE_SCRIPT_DIR}/platforms\n\nif [ -d \"${BUNDLE_DIR}\" ]\nthen\nrm -rf \"${BUNDLE_DIR}\"\nfi\nmkdir -p \"${BUNDLE_DIR}\"\nmkdir -p \"${BUNDLE_SCRIPT_DIR}\"\nmkdir -p \"${BUNDLE_PLATFORM_DIR}\"\n\n#存放压缩工具的文件夹,被压缩的JS文件都要先复制到此处\nCOMPRESS_DIR=${SRCROOT}/../JSCompressUtil\n\n#源bundle文件夹,获取所有需要的被压缩的js文件\nSOURCE_DIR=${SRCROOT}/../SDK/ShareSDK/Support/Required/ShareSDK.bundle\nSCRIPTCORE_DIR=${SOURCE_DIR}/ScriptCore/\n\n#复制.Iproj\ncd ${SOURCE_DIR}\nfor iproj in `ls -F | grep '.lproj'`\ndo\ncp  -r \"${iproj}\" \"${BUNDLE_DIR}/${iproj}\"\ndone\n\n#复制NativeExt.js & ShareSDK.js\ncd ${SCRIPTCORE_DIR}\nfor jsfile in `ls *.js`\ndo\ncp $jsfile ${COMPRESS_DIR}\ndone\n\n#复制各个平台的js\ncd ${SCRIPTCORE_DIR}/platforms\nfor jsfile in `ls *.js`\ndo\ncp $jsfile ${COMPRESS_DIR}\ndone\n\n#进行各个js进行压缩加密\ncd ${COMPRESS_DIR}\nfor jsfile in `ls *.js`\ndo\nJS_HEAD=`sed -n '9,9p' $jsfile`\nsed -i \"\" '9d' $jsfile\nbash ${COMPRESS_DIR}/uglify.sh $jsfile\necho  -n \"$JS_HEAD\" >$jsfile\ncat ${jsfile%.*}.min.js >>$jsfile\ncat $jsfile >${jsfile%.*}.min.js\nrm -f $jsfile\nmv ${jsfile%.*}.min.js ${BUNDLE_PLATFORM_DIR}\ndone\n\n#修改被压缩后的文件后缀\ncd ${BUNDLE_PLATFORM_DIR}\n\nfor files in `ls *.js`\ndo\nmv $files ${files%.*}\ndone\n\nfor files in `ls *.min`\ndo\nmv $files $(echo $files|sed 's/\\.min/\\.js/')\ndone\n\n#将压缩后的NativeExt.js & ShareSDK.js放回正确位置\n\nmv NativeExt.js ${BUNDLE_SCRIPT_DIR}\nmv ShareSDK.js ${BUNDLE_SCRIPT_DIR}\n\n";
		};
